import { height } from "dom-helpers";
import React from "react";

class MenuEmployee extends React.Component{
    render(){
        return(
            <div>
                <img style={height} src="https://i.pinimg.com/736x/c9/3b/a4/c93ba4038f42835e005356a3bc51d4ac.jpg" alt=""></img>
                <h3>Employee</h3>
            </div>
        )
    }
}
export default MenuEmployee;
